import React from 'react';
import './AppStore.css'

import Ferp from './resources/Calendar - Blank.png'

//Simple Info View on Top of AppStore Page
function AppStoreScreen() {
    return(
        <section className="background_ios1">
            <SimpleInfo></SimpleInfo>
            {/* line for distribute */}
            <hr
                style={{
                    color: "red",
                    backgroundColor: "red",
                    height: 1
                }}
            />
            <DescriptionInfo></DescriptionInfo>
        </section>
    );
}

const NaviInfo = () => {
    return(<div></div>);
}

const SimpleInfo = () => {
    return(
        <article className="simple_info">
            <img src={Ferp} alt="logo" className="logo"></img>
            <div className="AppName">Ferp</div>
            <div className="CompanyName">UCI</div>
            <div className="InstallButton"></div>
            <div className="BlankNull"></div>
            <div className="OtherButton"></div>
        </article>
    )
}

const DescriptionInfo = () => {
    return(
        <div></div>
    )
}

export default AppStoreScreen
